
public class SumOfNum {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println("program to find some of natural numbers from 5 to 25");
		
		int i, sum=0; 
		
		for(i=5;i<=25;i++) {
		sum += i;
		}
		System.out.println("sum of natural numbers from 5 to 25 is:" + sum);

	}

}
